    false,nt"url": null,nt"notes": "Sediment and fish samples collected from
    Kirwin National Wildlife Refuge in 1989 were analyzed for natural and anthropogenic
    contaminants. " Concentrations of all metals except chromium, tin, and zinc were
    within normal ranges in fish and sediments. Chromium concentrations in gizzard shad
    from Kirwin Reservoir indicate contamination. " Chlorphenoxy acid herbicides were
    not detected in any sample for which they were tested. " Organochlorine compound
    concentrations were low in all samples. " Analyses for aliphatic hydrocarbons were
    done on sediment samples from Bow Creek and from the Solomon River, and on two common
    carp composites from Kirwin Reservoir. Aliphatic compounds were found at very low
    concentrations in sediments, but at high concentrations in the carp.",nt"license_title":
